const initialState= {
    products: []
}

const productReducer =(state=initialState, action)=>{
    console.log('reducer data',action.payload);
    switch(action.type){
        case 'FETCH_PRODUCT':{
            return {
                ...state,
                products:action.payload
            }
        }
        default:
        return state;

    }
}
export default productReducer;
